description:
Field Descriptions

HIST_NAME = historic name

HIST_USE = historic use;

CUR_NAME = current name;

CUR_USE = current use;

CONST_YEAR = year
constructed (if known);

ARCHITECTS = architects who
designed project;

CONTRACTOR = contractor who
worked on project;

STYLE = architectural styleLOCAL_DESI = year
locally designated

SIGNIFICAN = historic
criteria in which it is significant

For
questions about this data please contact?CPEDOpenData@minneapolismn.gov
